import React from 'react';

const Header = () => {
  return (
    <div className="bg-gray-800 text-white py-4 px-8 flex justify-between items-center">
      <div>
        <span className="text-xl font-semibold">Book Review Web</span>
      </div>
      <div className="flex items-center">
        <input
          type="text"
          placeholder="Search for books..."
          className="p-2 rounded-lg mr-4"
        />
        <button className="bg-blue-500 px-4 py-2 rounded-md hover:bg-blue-600 mr-4">
          Search
        </button>
        <a href="/signup" className="mr-4">Sign Up</a>
        <a href="/signin" className="mr-4">Sign In</a>
        <a href="/about">About</a>
      </div>
    </div>
  );
};

export default Header;
